parameters.template:
{% comment %} REJECT THE PARENT IF MORE THAN ONE PAYMENT FOR THE PARENT {% endcomment %}
{% assign rejectedParents = '' | split: ',' %}
{% assign _parents = Data.AllocationJson | map: "Parent Account Number" | uniq %}
{% for p in _parents %}
   {% assign _no_of_payments = Data.AllocationJson | where: "Parent Account Number", p | map: "Parent Payment Number" | uniq | size %}
   {% if _no_of_payments > 1 %} {% assign rejectedParents = rejectedParents | push: p %} {% endif %}
{% endfor %}

{% assign _parentAccounts = '' | split: "," %}
{% assign _p = Data.AllocationJson | map: "Parent Account Number" | uniq %}

{% comment %} LOOP ON UNIQUE PARENT ACCOUNTS {% endcomment %}
{% for n in _p %}
 
 {% if rejectedParents contains n %} {% continue %} {% endif %}
 {% assign _pymts = Data.AllocationJson | where: "Parent Account Number", n | map: "Parent Payment Number" | uniq %}
 {% for m in _pymts %}
 
   {% assign _transactionAmounts = Data.AllocationJson | where: "Parent Account Number", n | where: "Parent Payment Number", m | map: "Transaction Amount" %}
   {% assign _surchargeAmounts = Data.AllocationJson | where: "Parent Account Number", n | where: "Parent Payment Number", m | map: "Surcharge Amount" %}
 
   {% assign _sum = 0 %}
   {% assign _isNegative = false %}

   {% comment %} ADD TRANSACTION AMOUNTS FOR THE PARENT {% endcomment %}
   {% for a in _transactionAmounts %}
      {% assign _tmp = a | plus: 0 %}
      {% comment %} IF NEGATIVE, BREAK LOOP {% endcomment %}
      {% if _tmp < 0 %} {% assign _isNegative = true %} break {% endif %}
      {% assign _sum = _sum | plus: a %}
    {% endfor %}

    {% comment %} IF ANY NEGATIVE, SKIP THIS PAYMENT. INTEGRITY OF INPUT IS QUESTIONABLE {% endcomment %}
    {% if _isNegative %} {% continue %} {% endif %}

    {% comment %} INCLUDE SURCHARGE AMOUNTS FOR THE PARENT {% endcomment %}
    {% for a in _surchargeAmounts %}
      {% assign _tmp = a | plus: 0 %}
      {% comment %} IF NEGATIVE, BREAK LOOP {% endcomment %}
      {% if _tmp < 0 %} {% assign _isNegative = true %} break {% endif %}
      {% assign _sum = _sum | minus: a %} 
    {% endfor %}

    {% comment %} IF NEGATIVE, SKIP THIS PAYMENT. INTEGRITY OF INPUT IS QUESTIONABLE {% endcomment %}
    {% if _isNegative or _sum <= 0 %} {% continue %} {% endif %}

   {% assign _value = n | append: "=" | append: m | append: ":" | append: _sum %}

   {% comment %} RECORD SUMMARY DATA FOR PER PARENT-PAYMENT {% endcomment %}
   
   {% assign _parentAccounts = _parentAccounts | push: _value %}
   
   {% endfor %}
   
  {% endfor %}

{% comment %} CONVERT DELIMITED SUMMARY PARENT DATA TO JSON {% endcomment %}
$append([],$map({{ _parentAccounts | to_json }}, function($v, $i, $a) {
    { 
      "parentAccountNumber": $split($v, '=')[0], 
  		"parentPaymentNumber": $split($split($v, '=')[1], ':')[0],
			"splitTotal": $split($split($v, '=')[1], ':')[1],
      "hasErrored": false
    }
}))

