exports.step = function myFunction(input) {
  var maxDuration = parseInt(input["Liquid"]["maxDuration"]);
  var maxDate = input["Liquid"]["maxdate"];

  function applyTriggerEvent(obj, maxDuration, maxDate) {
    if (obj.hasOwnProperty('triggerDate') && obj.hasOwnProperty('billingTiming')) {
      if (obj.triggerDate != null) {
        obj.triggerEvent = 'USD';
      } else {
        delete obj.triggerEvent;
      }
     
    }
  }

  function removeFields(obj) {
    const fieldsToRemove = [
      "id",
      "amendedByOrderOn",
      "billingDay",
      "chargedThroughDate",
      "currency",
      "discountApplyDetails",
      "discountClass",
      "dmrc",
      "done",
      "dtcv",
      "effectiveEndDate",
      "effectiveStartDate",
      "inputArgumentId",
      "mrr",
      "name",
      "originalChargeId",
      "originalOrderDate",
      "overageCalculationOption",
      "pricingSummary",
      "processedThroughDate",
      "segment",
      "smoothingModel",
      "specificListPriceBase",
      "tcv",
      "type",
      "uom",
      "model",
      "usageRecordRatingOption",
      "version",
      "quantity",
      "number",
"productRatePlanChargeNumber"
    ];

    fieldsToRemove.forEach(field => {
      delete obj[field];
    });

    if (Array.isArray(obj.chargeOverrides)) {
      obj.chargeOverrides = obj.chargeOverrides.filter(item => item !== null);
    } else if (typeof obj.chargeOverrides === 'object' && obj.chargeOverrides !== null) {
      obj.chargeOverrides = [obj.chargeOverrides];
    }

    if (obj.endDateCondition === "One_Time") {
      delete obj.endDateCondition;
      
    }
  }

  function moveDurationToChargeOverrides(obj) {
    var Discount = input["JSONTransform"]["Discount"];
    if (obj.hasOwnProperty('duration') && obj.hasOwnProperty('chargeOverrides')) {
      const chargeOverrides = Array.isArray(obj.chargeOverrides) ? obj.chargeOverrides : [obj.chargeOverrides];
      chargeOverrides.forEach(chargeOverride => {
        if (Discount == false && (chargeOverride.model == 'DiscountFixedAmount' || chargeOverride.model == 'DiscountPercentage' )) {
          chargeOverride.applyDiscountTo = 'NULL';
           if(chargeOverride.endDateCondition == 'Specific_End_Date') {
            chargeOverride.specificEndDate =  obj.Startdate;
           }
        }
    if ((chargeOverride.billingTiming === 'IN_ARREARS' && obj.duration != null) || 
    (chargeOverride.billingTiming === 'IN_ADVANCE' && obj.duration != null)) {
          chargeOverride.upToPeriods = obj.duration;
          chargeOverride.endDateCondition = 'Fixed_Period';
          chargeOverride.upToPeriodsType = 'Days';
         chargeOverride.triggerDate = obj.Startdate;
             chargeOverride.billCycleType = "ChargeTriggerDay";
       
        
        chargeOverride.triggerEvent = 'USD';
        
        }
      });
      delete obj.duration;
      delete obj.Startdate;
    }
  }

  function filterNullValues(obj) {
    if (typeof obj !== 'object' || obj === null) {
      return obj;
    }

    if (Array.isArray(obj)) {
      return obj.map(item => filterNullValues(item));
    }

    applyTriggerEvent(obj, maxDuration, maxDate);
    removeFields(obj);
    moveDurationToChargeOverrides(obj);

    const filteredObj = {};
    Object.keys(obj).forEach(key => {
      const value = filterNullValues(obj[key]);
      if (value !== null) {
        filteredObj[key] = value;
      }
    });

    return Object.keys(filteredObj).length > 0 ? filteredObj : null;
  }

  const jsonTransform = input.JSONTransform;
  let subscribeToRatePlans = jsonTransform.subscribeToRatePlans;

  if (Array.isArray(subscribeToRatePlans[0])) {
    subscribeToRatePlans = subscribeToRatePlans.flat();
  }

  const filteredArray = subscribeToRatePlans.map(ratePlan => {
    const clonedRatePlan = JSON.parse(JSON.stringify(ratePlan));
    applyTriggerEvent(clonedRatePlan, maxDuration, maxDate);
    removeFields(clonedRatePlan);
    moveDurationToChargeOverrides(clonedRatePlan);
    const filteredRatePlan = filterNullValues(clonedRatePlan);
    return filteredRatePlan;
  });
  delete jsonTransform.Discount;

  return { ...jsonTransform, subscribeToRatePlans: filteredArray  };
};

