    moveDurationToChargeOverrides(obj);

    const filteredObj = {};
    Object.keys(obj).forEach(key => {
      const value = filterNullValues(obj[key]);
      if (value !== null) {
        filteredObj[key] = value;
      }
    });

    return Object.keys(filteredObj).length > 0 ? filteredObj : null;
  }

  const jsonTransform = result;
  let subscribeToRatePlans = jsonTransform.subscribeToRatePlans;

  if (Array.isArray(subscribeToRatePlans[0])) {
    subscribeToRatePlans = subscribeToRatePlans.flat();
  }

  const filteredArray = subscribeToRatePlans.map(ratePlan => {
    const clonedRatePlan = JSON.parse(JSON.stringify(ratePlan));
    applyTriggerEvent(clonedRatePlan);
    removeFields(clonedRatePlan);
    moveDurationToChargeOverrides(clonedRatePlan);
    const filteredRatePlan = filterNullValues(clonedRatePlan);
    return filteredRatePlan;
  });

  return { ...jsonTransform, subscribeToRatePlans: filteredArray  };
};

